import React from 'react';
import styled from 'styled-components';

const TodoHeadBox = styled.div`
  width: 100%;
  padding: 0 0 20px;
  box-sizing: border-box;
  border-bottom: 1px solid #e9ecef;

  h1{
    margin: 0 auto 10px ;
    font-size: 45px;
    text-align: center;
    color: #49C5B6;
  }
  h2{
    margin: 20px auto 5px;
    font-size: 30px;
    color: #495057;
  }
  .day {
    color: #495057;
    font-size: 20px;
  }
  .tasks{
    color: #12b886;
    font-size: 20px;
    margin-top: 20px;
    font-weight: bold;
  }
`;

function TodoHead(){

  return(
    <TodoHeadBox>
      <h1>TODO LIST</h1>
      <h2>2020.01.05</h2>
      <div className="day">화요일</div>
      <div className="tasks">할일 몇개 남음</div>
    </TodoHeadBox>
  );
}

export default TodoHead;
